__NUXT_JSONP__("/drugs/Anti-VEGFANG2_Nanobody_BI_836880", (function(a,b,c,d){return {data:[{drug:{slug:b,emaEpar:[],fdaDrugLabel:[],id:b,nciThesaurus:{casRegistry:a,chebiId:a,chemicalFormula:a,definition:"A nanobody directed against angiopoietin-2 (Ang2; ANGPT2)- and vascular endothelial growth factor (VEGF)-derived peptides, with potential antiangiogenic and antineoplastic activities. Anti-VEGF\u002FANG2 nanobody BI 836880 binds to Ang2 and VEGF and inhibits receptor binding; this prevents Ang2- and VEGF-mediated signaling and inhibits both tumor angiogenesis and tumor cell proliferation. Both VEGF and Ang2 are upregulated in a variety of cancer cell types and play a crucial role in angiogenesis. The nanobody is based on functional fragments of single-chain antibodies.",fdaUniiCode:"IS7N1X9TSW",identifier:"C126644",preferredName:c,semanticType:"Pharmacologic Substance",subclassOf:["C1742"],synonyms:["Anti-VEGF\u002FANG2 BI 836880",c,"BI 836880","BI-836880","Bi-specific Anti-VEGF\u002FAng2 Nanobody BI 836880"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FAnti-VEGFANG2_Nanobody_BI_836880",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("","Anti-VEGFANG2_Nanobody_BI_836880","Anti-VEGF\u002FANG2 Nanobody BI 836880","2021-10-30T13:30:47.353Z")));